app.get('/get_order',(req,res)=>{
    var id = req.query.id;
    var no = req.query.no;
    
    var s = query1('shunfeng', no);
    var url="https://www.aikuaidi.cn/query";
	request({
		url: url,
        method: "POST",
        headers: {
            'Content-Type': 'application/x-www-form-urlencoded'
        },
		body: 'order='+no+'&id='+id+'&s='+s}, function(error, response, body) {
        var retobj = new Object;
		if (!error && response.statusCode == 200) {
            var retobj = new Object;
            try{
                retobj.code = 0;
                retobj.res = JSON.parse(body);
                res.send(JSON.stringify(retobj));
            } catch(err) {
                retobj.code = 1;
                retobj.res = [];
                res.send(JSON.stringify(retobj));
            }
		} else  {
            retobj.code = 1;
            retobj.res = [];
            res.send(JSON.stringify(retobj));
        }
    });
})


